import React from 'react';
import logo from './logo.svg';
import './App.css';




const App = () => {
  return (
    <div className='app-wrapper'>

      <header className="header">
        <img src='data:image/jpeg;base64,'></img>
      </header>

      <nav className='nav'>
        <div><a href='#'>Profile</a></div>
        <div><a href='#'>Messages</a></div>
        <div><a href='#'>News</a></div>
        <div><a href='#'>Music</a></div>
        <div><a href='#'>Settings</a></div>
      </nav>

      <div className='content'>
        <div>Main content </div>
        <img src="https://www.google.com/url?sa=i&source=imgres&cd=&cad=rja&uact=8&ved=2ahUKEwiGjva9y8_qAhU14aYKHV_2BdgQjRx6BAgBEAQ&url=https%3A%2F%2Fwww.flickr.com%2Fphotos%2Fme-graphy%2F7184786016&psig=AOvVaw16BM0WmXPga-JS9eLL2jB-&ust=1594913914655409"></img>
      </div>

    </div>
  );
}



export default App;
